import { Fragment } from "react";
import { Button, Form, FormGroup, Input, Label } from "reactstrap";

const FileUpload = () =>{
    return (
            <Form>
                <FormGroup>
                    <Input type="file" name="upload_file"/>
                    <Label>Choose File</Label> 
                </FormGroup>
                <FormGroup>
                    <Button color="primary">Upload</Button>
                </FormGroup>
            </Form>
    );
}
export default FileUpload;
